class SSEQ:
    def __init__(self):
        pass

    def get_subsequence_indexing(self,s,t):
        s_index = 0
        s_len = len(s)
        subsequence_indexing = []
        for letter in t:
            while(s_index < s_len and s[s_index] != letter):
                s_index += 1
            subsequence_indexing.append(s_index+1)
            s_index += 1
        return subsequence_indexing

def Main():
    sseq = SSEQ()
    #s = ''
    #t = 'GGCGCTTCGGTCAGAGGGGTAGGCTACACGTTTGTTATGTACGCAGCCGGCGCATC'
    s = ''
    t = ''
    print(*sseq.get_subsequence_indexing(s,t))

if __name__ == '__main__':
    Main()
